import { PEOPLE_DETAILS } from "../cardData"

export default function CardDetails(){

    const peopleDetails = PEOPLE_DETAILS.map((people) =>
    <ul class="bg-white w-96 mt-10" key ={people.name}>
        <li class="bg-cardBG h-20 "> <h4 class="align">{people.name}</h4></li>
        <li> {people.gender}</li>
        <li> {people.species}</li>
        <li> HomeWorld {people.homeworld}</li>
        <li> Vehicle{people.vehicles}</li>
        <li> Starship {people.starships}</li>

    </ul>)

return(

<>
{peopleDetails}
</>


)


}
